  false,\n\t\"url\": null,\n\t\"notes\": \"Shorelines were derived from a U.S. Geological
  Survey topographic lidar survey that was conducted on January 16-18, 2014 over Breton
  Island, Louisiana and released under USGS field activity number 14LGC01. Quantum
  Spatial was contracted by the USGS to collect and process these data. This dataset
  contains vectorized shorelines created from data acquired from Breton Island, Louisiana.
  Shorelines were vectorized in ArcMap 10.2.2 so they could be used for area and shoreline
  change analysis, using the Digital Shoreline Analysis System (DSAS) version 4.0.\",\n\t\"license_title\":
